Witam mam do sprzedania samochód osobowy marki Smart Fortwo wyprodukowany w 2006 roku, który został wyposażony w silnik benzynowy o pojemności 698 cm3, legitymujący się mocą 50 KM, który pokonał do tej pory 201000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Smart prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



Smart jest wyposażenia w:

- Elektryczne szyby przednie;

- ABS z ESP;

- Centralny zamek;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu umówienia się na oględziny i zakupu pojazdu.



OC ważne do 21.07.2025 roku.

Przegląd techniczny 07.03.2026 roku.

Dzień dobrym, mam do sprzedania samochód osobowy marki Tata Indica wyprodukowany w 2010 roku, zakupiony w PL salonie i był użytkowany przez jednego właściciela. Fabryka wyposażyła go w silnik benzynowy, doposażony w instalacje LPG ( butla ważna do 2031 roku) o pojemności 1360 cm3, legitymujący się mocą 85 KM, który pokonał do tej pory 137000 km. Samochód pod względem mechanicznym w bardzo dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów i sprzęgło pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Tata prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



Tata jest wyposażenia w:

- Klimatyzacje;

- Centralny zamek;

- 4 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 21.11.2025 roku.

Przegląd techniczny 30.06.2025 roku.
